    render(){
        return(
            <div id='registerApp'>
                <div id='topContainer'>
                    <div id='logoContainer'>
                        <p><span id='firstPartLogo'>Tudor</span><span>Flix</span></p>
                    </div>
                    <div id='signUpLinkContainer'>
                        <p>Don't have an account? <span id='createAccountLink'>Create Account</span></p>
